INSERT INTO [dbo].[Product] ([Id], [Title], [Description], [ImageURL], [Price], [DiscountPrice], [Rating]) VALUES (1, N'Apple iPhone XR', N'iPhone XR (stylized as iPhone XüÖÅ, Roman numeral "X" pronounced "ten") is a smartphone designed and manufactured by Apple, Inc. It is the twelfth generation of the iPhone. It was announced by Apple CEO Tim Cook on September 12, 2018, at Steve Jobs Theater in the Apple Park campus, alongside the higher-priced iPhone XS and iPhone XS Max. Pre-orders began on October 19, 2018, with an official release on October 26, 2018.[6]
INSERT INTO [dbo].[Product] ([Id], [Title], [Description], [ImageURL], [Price], [DiscountPrice], [Rating]) VALUES (2, N'Google Pixel 3', N'Unlike the Note 9, the Pixel 3 XL will sport a chunky notch to house its dual front-facing cameras and a sizable chin underneath the display. It''ll also feature a 2015-esque single-lens 12.2MP camera on its rear, whereas the Note 9 packs an upgraded 12MP dual camera system.', NULL, CAST(1000 AS Decimal(18, 0)), CAST(900 AS Decimal(18, 0)), 4)
